import React, { Component } from 'react'
import AvalibalImg from '../images/availible.png';
export default class Avalibal extends Component {
    render() {
        return (
            <div class="container" style={{display:'flex',paddingTop:'20px',marginTop:'50px'}}>
                <div style={{marginLeft:'400px',paddingRight:'90px'}}>
                    <h2 style={{paddingTop:"70px"}}>Also Avalibal At</h2>
                </div>
                <div class="img pl-3">
                    <div class="img1">
                <img src={AvalibalImg} alt="available at"/>
                    </div>
                </div>
            </div>
        )
    }
}
